import React from 'react'
import './AddProduct.css'

const AddProduct = () => {
  return (
    <div className='addproduct'>
        <div className="addproduct-itemfield">
            <p>Image title</p>
            <input type='text' name='name' placeholder='Type here'/>
        </div>
    </div>
  )
}

export default AddProduct
